import React from 'react';

function Cadastro() {
    return (
        <form method="post">
            <label htmlFor="email">E-mail: </label>
            <input id="email" type="text"/>
            <label htmlFor="password">Senha: </label>
            <input id="password" type="password"/>
        </form>
    );
}

export default Cadastro;
